import React, { useRef, useState, useEffect } from "react";
import { FaChevronLeft, FaChevronRight, FaMapMarkerAlt, FaRupeeSign } from "react-icons/fa";

const LatestProperties = () => {
  const sliderRef = useRef(null);
  const [isPaused, setIsPaused] = useState(false);

  // ⚙️ AUTO SCROLL SPEED (change yourself)
  const AUTO_SCROLL_SPEED = 0.6; // slow = 0.3, medium = 0.8, fast = 1.5

  // PROPERTY DATA
  const properties = [
    {
      id: 1,
      title: "Luxury 3 BHK Apartment",
      price: "75,00,000",
      location: "Mumbai, India",
      image: "https://images.unsplash.com/photo-1572120360610-d971b9d7767c?auto=format&fit=crop&w=800&q=60",
    },
    {
      id: 2,
      title: "Modern Villa With Pool",
      price: "1,50,00,000",
      location: "Goa, India",
      image: "https://images.unsplash.com/photo-1598928506311-c55ded1d52f7?auto=format&fit=crop&w=800&q=60",
    },
    {
      id: 3,
      title: "2 BHK Budget Flat",
      price: "35,00,000",
      location: "Pune, India",
      image: "https://images.unsplash.com/photo-1580587771525-78b9dba3b914?auto=format&fit=crop&w=800&q=60",
    },
    {
      id: 4,
      title: "Farmhouse with Greenery",
      price: "95,00,000",
      location: "Nashik, India",
      image: "https://images.unsplash.com/photo-1505691938895-1758d7feb511?auto=format&fit=crop&w=800&q=60",
    },
  ];

  // ♾ Infinite loop — duplicate list
  const loopList = [...properties, ...properties];

  // AUTO SCROLL
  useEffect(() => {
    const slider = sliderRef.current;

    const interval = setInterval(() => {
      if (!isPaused) {
        slider.scrollLeft += AUTO_SCROLL_SPEED;

        if (slider.scrollLeft >= slider.scrollWidth / 2) {
          slider.scrollLeft = 0;
        }
      }
    }, 10);

    return () => clearInterval(interval);
  }, [isPaused]);

  // BUTTON SCROLL
  const scrollLeft = () => (sliderRef.current.scrollLeft -= 300);
  const scrollRight = () => (sliderRef.current.scrollLeft += 300);

  return (
    <div className="w-full bg-[#0A1A2F] py-14 relative">
      <h2 className="text-3xl text-white font-bold text-center mb-10">
        Latest Properties
      </h2>

      {/* Slider Container (Center) */}
      <div className="max-w-[1400px] mx-auto relative px-10">

        {/* LEFT BUTTON */}
        <button
          onClick={scrollLeft}
          className="absolute left-0 top-1/2 -translate-y-1/2 bg-white/20 text-white p-3 rounded-full hover:bg-white/40 z-20"
        >
          <FaChevronLeft size={20} />
        </button>

        {/* RIGHT BUTTON */}
        <button
          onClick={scrollRight}
          className="absolute right-0 top-1/2 -translate-y-1/2 bg-white/20 text-white p-3 rounded-full hover:bg-white/40 z-20"
        >
          <FaChevronRight size={20} />
        </button>

        {/* SLIDER */}
        <div
          ref={sliderRef}
          className="flex gap-7 overflow-x-scroll no-scrollbar py-3"
          onMouseEnter={() => setIsPaused(true)}
          onMouseLeave={() => setIsPaused(false)}
        >
          {loopList.map((p, i) => (
            <div
              key={i}
              className="
                min-w-[260px] 
                sm:min-w-[280px] 
                md:min-w-[300px] 
                lg:min-w-[320px]
                bg-white/10 backdrop-blur-md 
                rounded-xl shadow-lg overflow-hidden
                hover:scale-[1.04] transition-all cursor-pointer
              "
            >
              {/* IMAGE */}
              <div className="h-[180px] w-full">
                <img src={p.image} alt="" className="w-full h-full object-cover" />
              </div>

              {/* CONTENT */}
              <div className="p-4">
                <h3 className="text-lg text-white font-semibold">{p.title}</h3>

                <p className="text-blue-300 flex items-center gap-1 text-sm font-medium">
                  <FaRupeeSign /> {p.price}
                </p>

                <p className="text-gray-300 flex items-center gap-1 text-sm mb-3">
                  <FaMapMarkerAlt /> {p.location}
                </p>

                <button className="w-full bg-blue-500 hover:bg-blue-600 text-white py-2 rounded-lg">
                  View Details
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* CSS */}
      <style>{`
        .no-scrollbar::-webkit-scrollbar {
          display: none;
        }
      `}</style>
    </div>
  );
};

export default LatestProperties;
